import React from 'react'

const Rhymes = (props) => {

  return(
    // <h2 className = {props.class}>{props.rhymes[0]} &emsp; {props.rhymes[1]} &emsp; {props.rhymes[2]} </h2>
    <h2 className = { props.class}>{props.rhymes.map((item, index) => {
      <span key = {index}>&emsp;{item}&emsp;</span>
    })}</h2>
  );
}

export default Rhymes
